import React, { Component } from 'react';
import Typed from 'react-typed';
import * as Scroll from 'react-scroll';
import scrollDown from "./scrollDown.png";
import { Element , Events, animateScroll as scroll, scrollSpy, scroller } from 'react-scroll';
import './home.css';

let Link = Scroll.Link;

export default class Home extends Component {
  render() {
    return(
      <React.Fragment>
        <div id='main' style={{backgroundColor: '#000000', fontFamily: 'Pier Sans', height: '100%'}}>
          <div className="centered">
              <span style={{color: '#ff5d73'}}>hi, </span><span>I'm </span>
              <Typed strings={['a computer science major.', 'an aspiring web designer.', 'a yellow jacket.', 'nikita bawa.']}
                   typeSpeed={40}
                   backSpeed={20}
                   backDelay={2000}
              />
          </div>
          <Link offset={-110} smooth={true} duration={500} to='about'>
            <div className="arrowDiv">
              <img className="scrollArrow" src={scrollDown}/>
            </div>
          </Link>
        </div>
      </React.Fragment>
    )
  }
}
